import React, { useState, useEffect, useRef } from 'react';
import VanillaTilt from 'vanilla-tilt';

/* Î∞îÎãêÎùº Ìã∏Ìä∏Î•º Ïã§ÌñâÏãúÌÇ§Í∏∞ ÏúÑÌïú Ìï®ÏàòÏûÖÎãàÎã§. - ÏûëÏóÖÏûê: Ïù¥Ï∞¨Ïö©
Ìã∏Ìä∏ÏïàÏóê ÏÜçÏÑ±ÏùÑ Ï§åÏúºÎ°úÏÑú Î∞îÎãêÎùº Ìã∏Ìä∏ Ï†úÏûëÏûêÍ∞Ä ÎßåÎì† Í∏∞Îä•Îì§ÏùÑ ÌôúÏö©Ìï©ÎãàÎã§.
Ïù¥ Î∞îÎãêÎùº Ìã∏Ìä∏Îäî Ï±ÑÌåÖÏ∞Ω ÎåÄÌôî ÎØ∏Î¶¨Î≥¥Í∞ÄÏóê Ï†ÅÏö© ÎêòÏóàÏäµÎãàÎã§.*/
function Tilt(props) {
  const { options, ...rest } = props;
  const tilt = useRef(null);

  useEffect(() => {
    VanillaTilt.init(tilt.current, options);
  }, [options]);

  return <div ref={tilt} {...rest} />;
}

// ÌåùÏóÖÏ∞ΩÏùÑ ÎÅÑÍ∏∞ ÏúÑÌï¥ ÎßåÎì† Ìï®ÏàòÏïàÏóê Îì§Ïñ¥Í∞ÄÎäî Î≥ÄÏàòÎ•º Îã¥Í∏∞ÏúÑÌïú Í≤ÉÏûÖÎãàÎã§. .-ÏûëÏóÖÏûê : Ïù¥Ï∞¨Ïö© 
const ChatList = () => {
  // isVisibleÏùò Ï¥àÍ∏∞Í∞íÏùÑ falseÎ°ú ÏÑ§Ï†ïÌïòÏó¨ ÏÉàÎ°úÏö¥ Î©îÏãúÏßÄÍ∞Ä ÏóÜÏùÑ ÎïåÎäî ÌåùÏóÖÏù¥ Îú®ÏßÄ ÏïäÎèÑÎ°ù ÌñàÏäµÎãàÎã§.
  const [isVisible, setIsVisible] = useState(false);
  const closePopup = () => {
    setIsVisible(false);
  };

  // Î∞îÎãêÎùº Ìã∏Ìä∏Î•º Ïã§ÌñâÏãúÌÇ§Í∏∞ ÏúÑÌïú Ìï®ÏàòÏûÖÎãàÎã§. -ÏûëÏóÖÏûê : Ïù¥Ï∞¨Ïö©
  const options = {
    scale: 1.01,
    speed: 1000,
    max: 5
  };

  // chat Îç∞Ïù¥ÌÑ∞Ïùò Ï¥àÍ∏∞Ìôî
  const [chats, setChats] = useState([
    { name: 'ÍπÄÏ∂òÏûê', content: 'ÎåÄÌôîÎÇ¥Ïö©ÏûÖÎãàÎã§.' },
    { name: 'Ïù¥Ìñ•Ïûê', content: 'ÎåÄÌôîÎÇ¥Ïö©ÏûÖÎãàÎã§.' },
    { name: 'Ï∂îÏ†ïÌôî', content: 'ÎåÄÌôîÎÇ¥Ïö©ÏûÖÎãàÎã§.' },
    { name: 'Ïù¥ÏòÅÏûê', content: 'ÎåÄÌôîÎÇ¥Ïö©ÏûÖÎãàÎã§.' },
  ]);

  // chats ÏÉÅÌÉú Í∞íÏù¥ Î≥ÄÌôîÌï† ÎïåÎßàÎã§ Ïã§ÌñâÎêòÎäî useEffectÎ•º Ï∂îÍ∞ÄÌñàÏäµÎãàÎã§. 
  // Ïù¥Î°úÏç® ÏÉàÎ°úÏö¥ Ï±ÑÌåÖÏù¥ Ï∂îÍ∞ÄÎê† ÎïåÎßàÎã§ isVisible ÏÉÅÌÉú Í∞íÏùÑ trueÎ°ú Î≥ÄÍ≤ΩÌïòÏó¨ ÌåùÏóÖÏ∞ΩÏùÑ ÎùÑÏõÅÎãàÎã§.
  useEffect(() => {
    setIsVisible(true);
  }, [chats]);

  return (
    <div className='chatlist_bg'>
      <div className={`chatlist_popup_page ${isVisible ? '' : 'hidden'}`}>
          <button className='chatlist_popup_page_close' onClick={closePopup}>X</button>
          <div className='chatlist_popup_page_text'>
            <h4>üí¨ ÏïåÎ¶º.</h4>
            <p>Ïù¥Ï∞¨Ïö©Îãò, ÏÑ§Î†àÏù¥Îäî ÏÉàÎ°úÏö¥ Î©îÏÑ∏ÏßÄÍ∞Ä ÎèÑÏ∞©ÌñàÏñ¥Ïöî!</p>
          </div>
        </div>

      <div className="login_bgm_b">
        <video className="login_bgm" autoPlay muted loop>
          <source src='videos/mainmain10.mp4' type='video/mp4' />
        </video>
      </div>

      <div className='chatlist_box'>
        <div className='chatlist_box_in'>
          <div className='chatlist_list_header'><h1>~ Ï±ÑÌåÖÏ∞Ω Î¶¨Ïä§Ìä∏ ~</h1></div>
          <hr/>
          <div className='chatlist_inner_box'>
            {chats.map((chat, index) => (
              <Tilt key={index} options={options} className='chat_list_contents'>
                <div className='chat_list_pro_img'></div>
                <p className='chat_list_name'>{chat.name}</p>
                <p className='chat_con_miri'>{chat.content}</p>
              </Tilt>
            ))}
          </div>
        </div>
      </div>
    </div>
  )
}

export default ChatList;
